                         dbo.JY70400V.VAERELSE_ANT AS ANTAL_VAERELSER, RTRIM(dbo.JY70400V.TOILET_KODE) AS TOILETFORHOLDSKODE, CAST(dbo.QL24500V.TEKST AS VARCHAR(80)) 
                         AS TOILETFORHOLD, RTRIM(dbo.JY70400V.BAD_KODE) AS BADEFORHOLDSKODE, CAST(dbo.QL24600V.TEKST AS VARCHAR(48)) AS BADEFORHOLD, 
                         RTRIM(dbo.JY70400V.KOEKKEN_KODE) AS KOEKKENFORHOLDSKODE, CAST(dbo.QL24700V.TEKST AS VARCHAR(43)) AS KOEKKENFORHOLD, 
                         dbo.JY70400V.ENERGI_KODE AS ENERGIFORSYNINGSKODE, CAST(dbo.QL24800V.TEKST AS VARCHAR(29)) AS ENERGIFORSYNING, 
                         dbo.JY70400V.ANDETAREAL AS ANDET_AREAL, dbo.JY70400V.GODKTOMBOLIGGL AS GODKENDT_TOM_BOLIG_GL, 
                         dbo.JY70400V.LOVLIG_ANVEND_KODE AS LOVLIG_ANVENDELSESKODE, CAST(dbo.QL25000V.TEKST AS VARCHAR(69)) AS LOVLIG_ANVENDELSE, 
                         dbo.JY70400V.TSDISPTIDS AS DATO_FOR_TIDSBEGR_DISP, dbo.JY70400V.ENH_SAGSTYPE AS SAGSTYPE_ENHED, 
                         dbo.JY70400V.ENH_DEL_IBRUG_DATO AS DATO_FOR_DELVIS_IBRUGTILLAD, dbo.JY70400V.ENH_UDLEJ2_KODE AS UDLEJNINGSFORHOLDSKODE, 
                         CAST(dbo.QL25200V.TEKST AS VARCHAR(18)) AS UDLEJNINGSFORHOLD, dbo.JY70400V.OFF_STOETTE_KODE AS OFFENTLIG_STOETTE, 
                         CAST(dbo.QL25300V.TEKST AS VARCHAR(30)) AS OFFENTLIG_STOETTE_TEKST, dbo.JY70400V.INDFLYTDATO AS DATO_FOR_INDFLYTNING, 
                         dbo.JY70400V.GODKTOMBOLIG AS GODKENDT_TOM_BOLIG, CAST(dbo.QL25400V.TEKST AS VARCHAR(35)) AS GODKENDT_TOM_BOLIG_TEKST, 
                         dbo.JY70400V.VARMEINSTAL_KODE AS VARMEINSTALLATIONSKODE, CAST(dbo.QL25500V.TEKST AS VARCHAR(77)) AS VARMEINSTALLATION, 
                         dbo.JY70400V.OPVARMNING_KODE AS OPVARMNINGSMIDDELSKODE, CAST(dbo.QL25600V.TEKST AS VARCHAR(46)) AS OPVARMNINGSMIDDEL, 
                         RTRIM(dbo.JY70400V.VARME_SUPPL_KODE) AS SUPPLERENDE_VARMEKODE, CAST(dbo.QL25700V.TEKST AS VARCHAR(43)) AS SUPPLERENDE_VARME, 
                         dbo.JY70400V.ANDELADGARE AS ANDEL_I_FAELLES_ADGANGSAREAL, dbo.JY70400V.AABENOVERDAEKAREAL AS SAMLET_AREAL_AABNE_OVERDAEK, 
                         dbo.JY70400V.LUKOVERDAEKAREAL AS SAML_AREAL_LUKKEDE_OVERDAEK, dbo.JY70400V.VAER_ERHV_ANT AS ANTAL_VAERELSER_TIL_ERHVERV, 
                         dbo.JY70400V.ANTVANSKYL AS ANTAL_VANDSKYLLEDE_TOILETTER, dbo.JY70400V.ANTBADEVAERELSER AS ANTAL_BADEVAERELSER, 
                         dbo.JY70400V.OPRET_TS AS OPRET_TIMESTAMP, dbo.JY70400V.AENDR_TS AS AENDRET_TIMESTAMP, dbo.JY70400V.OPHOERT_TS AS OPHOERT_TIMESTAMP, 
                         dbo.JY70400V.GYLDIGHEDSDATO, dbo.JY72100V.VEJ_KODE AS VEJKODE, RTRIM(dbo.JY72100V.HUS_NUMMER) AS HUSNUMMER, RTRIM(dbo.JY72100V.ETAGE) AS ETAGE, 
