                         dbo.JY72000V.POSTNR AS POSTNUMMER, dbo.JY72000V.POSTBYNAVN AS POSTDISTRIKT, CAST(dbo.JY72100V.KOMMUNENUMMER AS VARCHAR(3)) 
                         + RIGHT('0000' + CONVERT(VARCHAR, dbo.JY72100V.VEJ_KODE), 4) + RTRIM(dbo.JY72100V.HUS_NUMMER) AS ADRESSELINK_ID, 
                         CAST(dbo.JY72100V.KOMMUNENUMMER AS VARCHAR(3)) + CAST(dbo.JY72100V.VEJ_KODE AS VARCHAR(4)) + RTRIM(dbo.JY72100V.HUS_NUMMER) 
                         AS ADRESSE_ID, CAST(dbo.JY72100V.KOMMUNENUMMER AS VARCHAR(3)) + CAST(dbo.JY72100V.VEJ_KODE AS VARCHAR(4)) 
                         + RTRIM(LTRIM(dbo.JY72100V.HUS_NUMMER)) + RTRIM(LTRIM(dbo.JY72100V.ETAGE)) + RTRIM(LTRIM(dbo.JY72100V.SIDE_DOERNR)) AS UDVADRESSEID, 
