                         dbo.QL24800V ON dbo.JY70400V.ENERGI_KODE = dbo.QL24800V.KODE LEFT OUTER JOIN
                         dbo.QL24700V ON dbo.JY70400V.KOEKKEN_KODE = dbo.QL24700V.KODE LEFT OUTER JOIN
                         dbo.QL24600V ON dbo.JY70400V.BAD_KODE = dbo.QL24600V.KODE LEFT OUTER JOIN
                         dbo.QL24500V ON dbo.JY70400V.TOILET_KODE = dbo.QL24500V.KODE LEFT OUTER JOIN
                         dbo.JY72100V ON dbo.JY70400V.EAD_ID = dbo.JY72100V.EAD_ID LEFT OUTER JOIN
                         dbo.JY72000V ON dbo.JY72100V.ADG_ID = dbo.JY72000V.ADG_ID